Create and configure bucket policies in AWS to grant permission to your S3 buckets.

Review the Data Cloud IP Allowlist to make sure the IP addresses are allowlisted.

Bucket Permissions for Ingestion and Activation

Provide sufficient and correct bucket permissions for ingestion or activation jobs to execute successfully.

Bucket permissions required for ingestion:

GetBucketLocation
GetObject
ListBucket

Bucket permissions required for activation:

DeleteObject
GetBucketLocation
GetObject
ListBucket
PutObject

{
    "Version": "2012-10-17",
    "Statement": [
        {
            "Sid": "",
            "Effect": "Deny",
            "Principal": "*",
            "Action": "s3:*",
            "Resource": "arn:aws:s3:::test1-xyzt2-cdc001-mc-app/*",
            "Condition": {
                "Bool": {
                    "aws:SecureTransport": "false"
                        }
                        }
        },
        {
            "Effect": "Allow",
            "Principal": {
                "AWS": "arn:aws:iam::638002277144:user/blah-22-01-20"
                },
            "Action": [
                "s3:GetBucketLocation",
                "s3:ListBucket",
                "s3:GetObject*",
                "s3:PutObject*",
                "s3:GetObjectTagging",
                "s3:DeleteObject"
              ],
            "Resource": [
                "arn:aws:s3:::blah-data-exchange-blah",
                "arn:aws:s3:::blah-data-exchange-blah/*"
              ]
        }
    ]
}

Bucket Policies in AWS for VPC Endpoints

{
            "Version": "2012-10-17",
            "Id": "Policy55",
            "Statement": [
            {
            "Sid": "Access-to-specific-VPCE-only",
            "Effect": "Deny",
            "Principal": "*",
            "Action": "s3:*",
            "Resource": "arn:aws:s3:::cdpdemo123",
            "Condition": {
            "StringNotEquals": {
            "aws:SourceVpce": "vpce-7e4ef417", // Salesforce VPCE
            "aws:PrincipalAccount": "12345678911" //Keeps you from getting locked out of your bucket                }
            }
            }
            ]
            }

{
            "Version": "2012-10-17",
            "Id": "Policy55",
            "Statement": [
            {
            "Sid": "Access-to-specific-VPCE-only",
            "Effect": "Deny",
            "Principal": "*",
            "Action": "s3:*",
            "Resource": "arn:aws:s3:::cdpdemo123",
            "Condition": {
            "StringNotEquals": {
            "aws:PrincipalArn": "arn:aws:iam::123456789111:user/user-name-1", // Allows this user to manage the bucket
            "aws:SourceVpce": "vpce-7e4ef417"
            }
            }
            }
            ]
